import React from "react";
const SearchBar = () => {
  const submitHandler = (events) => {
    events.preventDefault();
  };
  return (
    <React.Fragment>
      <section id="section-1">
        <h1 class>A fresh approach to shopping.</h1>
        <div className="borderTag"></div>
        <div className="searchBar">
        <input type="text" id="search"/>
        <button type="submit" className="btn-search" onClick={submitHandler} placeholder="Search..">
          Submit
        </button>
        </div>
      </section>
    </React.Fragment>
  );
};

export default SearchBar;
